import BoardFactory from "./Board";

const ChessFactory = () => {

    return Object.create({
        board: BoardFactory(),
        boardToString() {
            console.log(this.board.board.forEach(element => {
                element.forEach(piece => {
                    if (piece === null) {
                        return null;
                    } else {
                        return piece.piece;
                    }
                })
            }));
        }
    })

}

export default ChessFactory;
